function SmallCard({img, location, title}) {
    return (
        <div className="flex items-center m-2 mt-5 space-x-4 rounded-xl cursor-pointer
        hover:bg-gray-100 hover:scale-105 transition transform duration-200 ease-out
        ">
            {/* Left */}
            <div className="relative h-100 w-10">
                <img src={img} className="object-cover h-100 w-full rounded-lg"/>
            </div>
            <div>
                <h2>{title}</h2>
            </div>
        </div>
    )
}

export default SmallCard
